import React from "react";
import ReactDOM from "react-dom";
import "./main.css"

function header() {
    return <header>
        <img src="producthunt.jpeg" alt="producthunt"/>
    </header>
}

function App(){
  return    <div className="first">
                <img src="event.jpeg" alt="event" width="70" />
                <h3>Coders Rank</h3><br/>
                 <p>The ultimate profile for developers</p>
             </div>
}

ReactDOM.render(App(), document.getElementById("root"))
ReactDOM.render(header(), document.getElementById("main"))
